import React, { Fragment } from "react";
import "../../App.css";
import Header from "../../Components/Header/Header";
import DoctorIntro from "../../Components/DoctorIntro/DoctorIntro";
import DoctorBlock from "../../Components/DoctorBlock/DoctorBlock";
import TimeDropdown from "../../Components/TimeDropdown/TimeDropdown";
import BookingContainer from "../../Components/BookingContainer/BookingContainer";

const Appointments = (props, state) => {
  state = {
    doctor_id: null,
  };
  const { doctor_id, user, doctor_name } = props.location.state;
  console.log("doctor id", doctor_id);
  console.log("user", user);

  //Set state

  return (
    <div className="App">
      <Header portal="Upcoming Appointments"></Header>
      <BookingContainer
        doctor_id={doctor_id}
        user={user}
        doctor_name={doctor_name}
      ></BookingContainer>
    </div>
  );
};

export default Appointments;
